description:
The Pretenders - Day After Day [promo].mpg


Very rare promo music video. One of my first downloads from my collection. 
&quot;Day After Day&quot; from the album &quot;Pretenders II&quot;, spins a common second-album 
narrative of unaccustomed celebrity, with the band rushing from gig to gig, 
hotel to hotel, head-spun from the swiftness of it all.


